import React, { useEffect, useState } from "react";
import './Doctprofile.css';
import axios from "axios";
function Doctprofile() {
    const [person, setperson] = useState([]);

    useEffect(() => {
        axios.get("http://localhost:5000/doctor")
            .then(res => {
                setperson(res.data);
            });
    }, [])

    function deletedoct(e) {
        console.log(e.target.id);
    }

     const row= [];
    for (let index = 0; index < person.length; index += 3) {
        row.push(person.slice(index, index + 3));
    }
   function lengthrow (){
       return row.length;
   }
    return (
        <div class="container">
            {row.map((personc) => (
                <div class="row">
                    {personc.map((persons) => (
                        <div class="card cr">
                            <div class="card-body" key={Math.random()}>
                                <table className="table">
                                    <tbody>
                                        <tr>
                                            <td>Full Name</td>
                                            <td>{persons.name}</td>
                                        </tr>
                                        <tr>
                                            <td>Specialised</td>
                                            <td>{persons.specialised}</td>
                                        </tr>
                                        <tr>
                                            <td>Hours Work</td>
                                            <td>{persons.hourwork}</td>
                                        </tr>
                                    </tbody>
                                </table>
                            </div>
                            <button onClick={deletedoct} id={persons._id} class="btn btn-success">Add</button>
                        </div>
                    ))}
                </div>
            ))}
        </div>
    );
}


export default Doctprofile;
